import NavigationBar from './components/NavigationBar';
import './App.css';
import RightScreen from './components/RightScreen';

function App() {
  return (
    <div className='app'>
      <div style={{ backgroundColor:'rgb(250, 250, 250);'}}>
        <NavigationBar/>
      </div>
      <div>
        <RightScreen/>
      </div>
    </div>

  );
}

export default App;
